import{_ as a}from"./chunks/gps_smartap_gps.CjgrrkC8.js";import{_ as r,c as e,a8 as l,o as s}from"./chunks/framework.BDnHobkS.js";const u=JSON.parse('{"title":"Sky-Drones SmartAP GPS","description":"","frontmatter":{},"headers":[],"relativePath":"uk/gps_compass/gps_smartap.md","filePath":"uk/gps_compass/gps_smartap.md"}'),i={name:"uk/gps_compass/gps_smartap.md"};function o(d,t,n,h,m,p){return s(),e("div",null,t[0]||(t[0]=[l('<h1 id="sky-drones-smartap-gps" tabindex="-1">Sky-Drones SmartAP GPS <a class="header-anchor" href="#sky-drones-smartap-gps" aria-label="Permalink to &quot;Sky-Drones SmartAP GPS&quot;">​</a></h1><p><a href="https://sky-drones.com/navigation/smartap-gnss.html" target="_blank" rel="noreferrer">SmartAP GPS</a> is a GNSS navigation module with integrated antenna, UBlox Neo-M8N chipset, 3x 3-axis magnetometer (compass), 1x MS-5611 pressure sensor and RGB LED driver. SmartAP GPS підтримує одночасний прийом до 3 GNSS (GPS, Galileo, GLONASS, BeiDou).</p><p><img src="'+a+'" alt="SmartAP GPS"></p><p>Основні функції включають:</p><ul><li>Одночасний прийом до 3 GNSS (GPS, Galileo, GLONASS, BeiDou)</li><li>3х вбудовані магнітометри: HMC5983, IST8310 та LIS3MDL</li><li>1x вбудований барометр: MS5611</li><li>Драйвер RGB-світлодіодів та індикатори стану</li></ul><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><ul><li><a href="https://sky-drones.com/navigation/smartap-gnss.html" target="_blank" rel="noreferrer">Sky-Drones Store</a></li></ul><h2 id="вміст-набору" tabindex="-1">Вміст набору <a class="header-anchor" href="#вміст-набору" aria-label="Permalink to &quot;Вміст набору&quot;">​</a></h2><p>Набір SmartAP GPS включає в себе:</p><ul><li>1x GPS модуль</li><li>1x 30cm кабель</li></ul><h2 id="налаштування" tabindex="-1">Налаштування <a class="header-anchor" href="#налаштування" aria-label="Permalink to &quot;Налаштування&quot;">​</a></h2><p>For the aircraft, you should set the parameter <a href="./../advanced_config/parameter_reference.html#SER_GPS1_BAUD">SER_GPS1_BAUD</a> to 115200 8N1 to ensure that PX4 uses the correct baudrate.</p><h2 id="підключення-та-з-єднання" tabindex="-1">Підключення та з&#39;єднання <a class="header-anchor" href="#підключення-та-з-єднання" aria-label="Permalink to &quot;Підключення та з&#39;єднання&quot;">​</a></h2><p>SmartAP GPS має 10-контактний роз&#39;єм JST-GH, який можна підключити до польотного контролера Pixhawk (сумісний зі стандартом роз&#39;єму Pixhawk).</p><table tabindex="0"><thead><tr><th>Номер виводу</th><th>Назва виводу</th></tr></thead><tbody><tr><td>1</td><td>5V</td></tr><tr><td>2</td><td>USART1_RX</td></tr><tr><td>3</td><td>USART1_TX</td></tr><tr><td>4</td><td>I2C1_SCL</td></tr><tr><td>5</td><td>I2C1_SDA</td></tr><tr><td>6</td><td>SAFETY_BTN</td></tr><tr><td>7</td><td>SAFETY_LED</td></tr><tr><td>8</td><td>+3V3</td></tr><tr><td>9</td><td>BUZZER</td></tr><tr><td>10</td><td>GND</td></tr></tbody></table><h2 id="специфікація" tabindex="-1">Специфікація <a class="header-anchor" href="#специфікація" aria-label="Permalink to &quot;Специфікація&quot;">​</a></h2><ul><li>Приймач GPS u-blox M8N</li><li>Магнітометр IST8310</li><li>Магнітометр HMC5983</li><li>Магнітометр LIS3MDL</li><li>Датчик тиску MS5611</li><li>Світлодіоди RGB для показу статусу <ul><li>NCP5623 I2C Driver</li></ul></li><li>Діаметр: 75 мм</li><li>Вага: 34g</li></ul><h2 id="подальша-інформація" tabindex="-1">Подальша інформація <a class="header-anchor" href="#подальша-інформація" aria-label="Permalink to &quot;Подальша інформація&quot;">​</a></h2><ul><li><a href="https://sky-drones.com/navigation/smartap-gnss.html" target="_blank" rel="noreferrer">Buy SmartAP GPS</a></li><li><a href="https://docs.sky-drones.com/avionics/smartap-gnss" target="_blank" rel="noreferrer">Documentation</a></li><li><a href="https://docs.sky-drones.com/avionics/smartap-gnss/cad-model" target="_blank" rel="noreferrer">CAD Models</a></li></ul>',19)]))}c